import React from 'react'


function Test() {

    const news = [
        {
            p : 'item'
        },
    
        { 
            p : 'item'
        },
    
        {
            p : 'item'
        },
    
        { 
            p : 'item'
        },
    
        {       
            p : 'item'
        },
    
        {       
            p : 'item'
        },
    
        {       
            p : 'item'
        }
    ]
  return (
    <div>
      {news.map((item, index) =>
      {
        return(
            <div className="content" key={index}>
                <p>{item.p}</p>
               
            </div>
        )
      })}
    </div>
  )
}

export default Test
